$(document).ready(function(){$("#btnValidarContratos").click(function(){for(var e=$("#totalRegistros").val(),t=0;t<e;t++){var a=new Date;a.getFullYear()+"-"+("0"+(a.getMonth()+1)).slice(-2)+"-"+a.getDate()==$("#proximaFecha"+t).val()&&Swal.fire({title:"¡ATENCIÓN!",text:"¡El día de hoy hay empleados que deben de firmar contrato!",type:"info",timer:3e3})}})});